<script>

import jQuery from 'jquery';

const $ = jQuery;

export default {
  name: 'animatedcity',
  props: {

  },
  mounted() {
    // Illustration By Rick Granados

    $('button').on('click', (e) => {
      drawSVGPaths('svg', 250, 500, 25);
    });

    jQuery.extend(
      jQuery.easing,
      {
        easeInOutQuad(x, t, b, c, d) {
          if ((t /= d / 2) < 1) return c / 2 * t * t + b;
          return -c / 2 * ((--t) * (t - 2) - 1) + b;
        },
      },
    );

    function SVG(tag) {
      return document.createElementNS('http://www.w3.org/2000/svg', tag);
    }

    function replaceRectsWithPaths(parentElement) {
      const rects = $(parentElement).find('rect');

      $.each(rects, function () {
        const rectX = $(this).attr('x');
        const rectY = $(this).attr('y');

        const rectX2 = parseFloat(rectX) + parseFloat($(this).attr('width'));
        const rectY2 = parseFloat(rectY) + parseFloat($(this).attr('height'));

        const convertedPath = `M${rectX},${rectY} ${rectX2},${rectY} ${rectX2},${rectY2} ${rectX},${rectY2} ${rectX},${rectY}`;

        $(SVG('path'))
          .attr('d', convertedPath)
          .attr('fill', $(this).attr('fill'))
          .attr('stroke', $(this).attr('stroke'))
          .attr('stroke-width', $(this).attr('stroke-width'))
          .attr('stroke-linecap', $(this).attr('stroke-linecap'))
          .insertAfter(this);
      });

      $(rects).remove();
    }
    function replaceLinesWithPaths(parentElement) {
      const lines = $(parentElement).find('line');

      $.each(lines, function () {
        const lineX1 = $(this).attr('x1');
        const lineY1 = $(this).attr('y1');

        const lineX2 = $(this).attr('x2');
        const lineY2 = $(this).attr('y2');

        const convertedPath = `M${lineX1},${lineY1} ${lineX2},${lineY2}`;


        $(SVG('path'))
          .attr('d', convertedPath)
          .attr('fill', $(this).attr('fill'))
          .attr('stroke', $(this).attr('stroke'))
          .attr('stroke-width', $(this).attr('stroke-width'))
          .attr('stroke-linecap', $(this).attr('stroke-linecap'))
          .insertAfter(this);
      });

      $(lines).remove();
    }

    function replaceCirclesWithPaths(parentElement) {
      const circles = $(parentElement).find('circle');

      $.each(circles, function () {
        const cX = $(this).attr('cx');
        const cY = $(this).attr('cy');
        const r = $(this).attr('r');
        const r2 = parseFloat(r * 2);

        const convertedPath = `M${cX}, ${cY} m${-r}, 0 ` + `a ${r}, ${r} 0 1,0 ${r2},0 ` + `a ${r}, ${r} 0 1,0 ${-r2},0 `;

        $(SVG('path'))
          .attr('d', convertedPath)
          .attr('fill', $(this).attr('fill'))
          .attr('stroke', $(this).attr('stroke'))
          .attr('stroke-width', $(this).attr('stroke-width'))
          .attr('stroke-linecap', $(this).attr('stroke-linecap'))
          .insertAfter(this);
      });

      $(circles).remove();
    }


    function replaceEllipsesWithPaths(parentElement) {
      const ellipses = $(parentElement).find('ellipse');

      $.each(ellipses, function () {
        const cX = $(this).attr('cx');
        const cY = $(this).attr('cy');
        const rX = $(this).attr('rx');
        const rY = $(this).attr('ry');

        const convertedPath = `M${cX}, ${cY} m${-rX}, 0 ` + `a ${rX}, ${rY} 0 1,0 ${rX * 2},0 ` + `a ${rX}, ${rY} 0 1,0 ${-rX * 2},0 `;

        $(SVG('path'))
          .attr('d', convertedPath)
          .attr('fill', $(this).attr('fill'))
          .attr('stroke', $(this).attr('stroke'))
          .attr('stroke-width', $(this).attr('stroke-width'))
          .attr('stroke-linecap', $(this).attr('stroke-linecap'))
          .insertAfter(this);
      });

      $(ellipses).remove();
    }


    function replacePolygonsWithPaths(parentElement) {
      const polygons = $(parentElement).find('polygon');

      $.each(polygons, function () {
        const points = $(this).attr('points');
        const polyPoints = points.split(/[ ,]+/);
        const endPoint = `${polyPoints[0]}, ${polyPoints[1]}`;

        $(SVG('path'))
          .attr('d', `M${points} ${endPoint}`)
          .attr('fill', $(this).attr('fill'))
          .attr('stroke', $(this).attr('stroke'))
          .attr('stroke-width', $(this).attr('stroke-width'))
          .attr('stroke-linecap', $(this).attr('stroke-linecap'))
          .insertAfter(this);
      });

      $(polygons).remove();
    }

    function replacePolylinesWithPaths(parentElement) {
      const polylines = $(parentElement).find('polyline');

      $.each(polylines, function () {
        const points = $(this).attr('points');

        $(SVG('path'))
          .attr('d', `M${points}`)
          .attr('fill', $(this).attr('fill'))
          .attr('stroke', $(this).attr('stroke'))
          .attr('stroke-width', $(this).attr('stroke-width'))
          .attr('stroke-linecap', $(this).attr('stroke-linecap'))
          .insertAfter(this);
      });

      $(polylines).remove();
    }

    function hideSVGPaths(parentElement){
      const paths = $(parentElement).find('path');

      $.each(paths, function () {
        const totalLength = this.getTotalLength();

        $(this).css({
          'stroke-dashoffset': totalLength,
          'stroke-dasharray': `${totalLength} ${totalLength}`,
        });
      });
    }

    function drawSVGPaths(_parentElement, _timeMin, _timeMax, _timeDelay) {
      const paths = $(_parentElement).find('path');

      $.each(paths, function (i) {
        const totalLength = this.getTotalLength();

        $(this).css({
          'stroke-dashoffset': totalLength,
          'stroke-dasharray': `${totalLength} ${totalLength}`,
        });

        $(this).delay(_timeDelay * i).animate({
          'stroke-dashoffset': 0,
        }, {
          duration: Math.floor(Math.random() * _timeMax) + _timeMin,
          easing: 'easeInOutQuad',
        });
      });
    }

    function replaceWithPaths(parentElement) {
      replaceRectsWithPaths(parentElement);
      replaceLinesWithPaths(parentElement);
      replaceEllipsesWithPaths(parentElement);
      replaceCirclesWithPaths(parentElement);
      replacePolygonsWithPaths(parentElement);
      replacePolylinesWithPaths(parentElement);
    }

    function startSVGAnimation(parentElement) {
      drawSVGPaths(parentElement, 250, 500, 25);
    }

    replaceWithPaths($('svg'));
    startSVGAnimation($('svg'));
  },
};
</script>

